import axios from  'axios';


export const getUsers = () =>{
    return axios.get('/api/users'); 
}


export const getCustomers = () =>{
    return axios.get('/api/customers'); 
}


export const getVendors = () =>{
    return axios.get('/api/vendors'); 
}



export default {   
    getUsers,
    getCustomers
}
